import { Link } from "react-router-dom";

export default function Nav() {
  return (
    <ul>
          <ul className="ul"><li><Link to={'/'}><i>H</i>ome</Link></li></ul>
          <li><Link to={'/M'}>Movies</Link></li>
          <li><Link to={'/Crime'}>Crime</Link></li>
          
          <li><Link to={'/Search'}>Search</Link></li>
       </ul>
  );
}
